import React, {Component} from 'react';


class Table extends Component {;
    render() {
        //console.log("table组件更新搜索词",this.props.filterText)
        let studyFiltered = this.props.study;
        if (this.props.filterText !== '') {
            //使用正则表达式匹配
            studyFiltered = this.props.study.filter((study) => {
                return -1 !== study.patient["patient_id"].search(this.props.filterText);
            });
        }
        return (
            <div class="row">
                        {studyFiltered.map(study=> {
                            return (
                                <div>
                                    <div class="five wide colum"> 
                                        <div class="studyseriespatient">
                                            <h3 class="patientheader">Patient</h3>
                                            <h4>{study.patient["patient_id"]}</h4>
                                            <h5>Patient ID: </h5>
                                            <h5>{study.patient["patient_id"]}</h5>
                                            <br />
                                            <h5>Patient Gender: </h5>
                                            <h5>{study.patient["patient_sex"]}</h5>
                                            <br />
                                            <h5>Patient Age: </h5>
                                            <h5>{study.patient["patient_age"]}</h5>
                                        </div>
                                        <div class="studyseriedstudy">
                                            <h3 class="studyheader">Study</h3>
                                            <h4>MRI Hd wo+w</h4>
                                            <h5>Study Date: </h5>
                                            <h5>--</h5>
                                            <br />
                                            <h5>Referring Physician: </h5>
                                            <h5>--</h5>
                                        </div>
                                    </div>
                                    <div class="rightcolum"> 
                                        <div>
                                            <h4>Series {study.seried["id"]}</h4>
                                            <div class="series segment">
                                            <h5>Description: </h5>
                                            <h5>{study.study_description}</h5>
                                            <br />
                                            <h5>Modality: </h5>
                                            <h5>{study.modalities["0"]}</h5>
                                            <br />
                                            <h5>Body Part Examined: </h5>
                                            <h5>{study.series["body_part_examined"]}</h5>
                                            <br />
                                            <h5>Patient Position: </h5>
                                            <h5>{study.series["patient_position"]}</h5>
                                            <br />
                                            <h5>Series Number: </h5>
                                            <h5>{study.series["series_number"]}</h5>
                                            <br />
                                            <h5>Image Count: </h5>
                                            <h5>{study.image_count}</h5>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            )
                        })} 
            </div>
        )
    }
}
export default Table;
